func TestSolve(t *testing.T) {
	var b bytes.Buffer
	for i, test := range tests {
		fmt.Printf("Test #%v\n", i)
		solve(strings.NewReader(test[0]), &b)
		if b.String() != test[1] {
			t.Errorf("Errore test #%v\nAtteso:\n-----\n%s\n-----\nRicevuto:\n-----\n%s\n-----\n", i, test[1], b.String())
		}
		b.Reset()
	}
}
